import React, { useState } from "react";
import RegisterForm from "../../ui/registerForm";
import Header from "../../common/header/header";
import NavBarMenu from "../../ui/navBar/navBarMenu";

const RegisterPage = () => {
    const [isActive, setIsActive] = useState(false);
    const toggleMenu = () => {
        setIsActive(prevState => !prevState);
    };
    return (
        <div style={{ background: "#F1F3EF", height: "100%", minHeight: "100vh", position: "relative" }}>
            <Header color="white" isActive={isActive} onHandleClick={toggleMenu}/>
            {isActive ? <NavBarMenu color={"white"} /> : ""}
            <div style={{ background: "#497557", display: "flex", alignItems: "center" }} >
                <div className="container mt-5">
                    <div className="row my-5">
                        <div className="col-md-6 offset-md-3 shadow p-4" style={{ background: "white" }}>
                            <h3 className="mb-4">Register</h3>
                            <RegisterForm/>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default RegisterPage;
